import LeadingLogo from "../../img/oftb-logo.png";
import WelcomeStyles from "./WelcomeCard.module.css";
import TopMenu from "../TopMenu/TopMenu";
const WelcomeCard = () => {
    return (
        <>
            <TopMenu />
            <div className={WelcomeStyles.welcomeRoot}>
                <div className={WelcomeStyles.welcomeCard}>
                    <div className={WelcomeStyles.logoWrapper}><img src={LeadingLogo} className={WelcomeStyles.logo} /></div>
                    {/* <h1 className={WelcomeStyles.welcomeHeader}>For the stories you'll always remember!</h1> */}
                    <p>
                        Hey There, Memory Keeper!
                        You know those stories that get told over and over-the ones that start with "Remember when..." and end with everyone laughing, grinning, or feeling just a little teary-eyed? Those are the moments we live for, and One for the Books is here to make sure younever forget them.
                        This journal isn't just for writing; it's for celebrating the friendships and moments that make life unforgettable. It's a space to capture the laughter, the adventures, the heartfelt memories, and all the little in-between moments that matter most. These pages are where stories live, where friendships are honored, and where you can relive your very best "One for the Books" memories anytime you want.
                    </p>
                </div>
            </div>
        </>
    );
};

export default WelcomeCard;
